import React from "react";
import {Dialog } from "@mui/material";

const dialogStyle={
    height: "90%",
    marginTop: "12%"
}

const LoginDialog = () => {
  return (
   <div>
    <Dialog open={true} PaperProps={{sx: dialogStyle}}>
            HELLO THERE
    </Dialog>
   </div>
  );
};

export default LoginDialog;
